import React from 'react';
import Homepage from './components/homepage';
import Investasipage from './components/investasipage';
import DetailPage from './components/investasipage';
import 'bootstrap/dist/css/bootstrap.min.css';
import './assets/style/style.css'
import { BrowserRouter , Route, Switch} from "react-router-dom";

function App() {
  return (
  <BrowserRouter>
  <div>
    <Route exact path='/' component={Homepage} />
    <Switch>
    <Route  path='/investasi' component={Investasipage} />
    <Route  path='/investasi/:id' component={DetailPage} />
    </Switch>
  </div>
  </BrowserRouter>
  );
}

export default App;
